// para utilizar los path es necesario instalar el reach router nmp install react-router-dom
import {BrowserRouter,Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div>








      <h1>Consultorio Online</h1>
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<ListaUsuarios/>} exact></Route>
        <Route path='/agregarusuarios' element={ <AgregarUsuarios/> }exact></Route>
        <Route path='/editarusuarios' element={ <EditarUsuario/>} exact></Route>
      </Routes>
      </BrowserRouter>





  </div>

  );  
}

export default App;
